%[text] # Estimate joint Vel/PWM response and Tune PID
%[text] Copyright (C) 2025 Fondazione Istitito Italiano di Tecnologia (IIT)
%[text] All Rights Reserved.
%[text] ### Import data
filename = "C:\dev\tmp\Nina_data\output_joint_5.csv"; %[control:filebrowser:0a45]{"position":[12,53]}
d = importdata(filename);

% Determine the sample time for collecting data
t  = round(d(:, 1) * 1e3);
Ts = mode(diff(t)) / 1e3;
fprintf("Sample time Ts = %g\n", Ts); %[output:4e91ae62]

% Determine the sample time factor of streaming encoder data
pos = d(:, 3);
change_indices = find(abs(diff(pos)) > eps);
all_indices    = [0; change_indices; numel(pos)];
run_lengths    = diff(all_indices);
n = mode(run_lengths);
fprintf("Sample time factor n = %d\n", n); %[output:43125f4c]
t      = (0:n:length(d)-1)' * Ts;
pos    = downsample(d(:, 3), n);
pwm    = downsample(d(:, 5), n);
v_in   = gradient(pos) / (n * Ts);
v_filt = medfilt1(v_in, 5);

data_vel = iddata(v_filt, pwm, n * Ts);
data_vel.InputName  = "pwm";
data_vel.OutputName = "vel";
data_vel.Tstart     = 0;

figure; %[output:31b21837]
tiledlayout(3, 1); %[output:31b21837]
h1 = nexttile; %[output:31b21837]
stairs(t, pwm); %[output:31b21837]
ylabel("%"); %[output:31b21837]
grid minor; %[output:31b21837]
legend({"PWM"}); %[output:31b21837]

h2 = nexttile; %[output:31b21837]
stairs(t, pos); %[output:31b21837]
ylabel("deg"); %[output:31b21837]
grid minor; %[output:31b21837]
legend("pos"); %[output:31b21837]

h3 = nexttile; %[output:31b21837]
stairs(t, [v_in v_filt]); %[output:31b21837]
ylabel("deg/s"); %[output:31b21837]
grid minor; %[output:31b21837]
legend({"vel_{in}", "vel_{filt}"}); %[output:31b21837]

xlabel("time (s)"); %[output:31b21837]
linkaxes([h1, h2, h3], 'x'); %[output:31b21837]
%[text] ### Estimate state-space model of Vel/PWM system response
ssOpts = ssestOptions;
ssOpts.Display = 'off';
ssOpts.Focus = 'simulation';
ssOpts.InitialState = 'zero';

order = 2;
ss = ssest(data_vel, order, 'Form', 'free', 'DisturbanceModel', 'none', ssOpts);

figure; %[output:479e2d98]
compare(data_vel, ss); %[output:479e2d98]
grid minor; %[output:479e2d98]
zpk(ss) %[output:913aee5d]
figure; %[output:526bc4c4]
pzmap(ss); %[output:526bc4c4]
grid minor; %[output:526bc4c4]
figure; %[output:36400538]
stepplot(ss); %[output:36400538]
grid minor; %[output:36400538]
%[text] ### Verify the Pos/PWM plant response
plant = ss / tf('s');
pos_sim = lsim(plant, pwm, t);

figure; %[output:6096ed56]
stairs(t, detrend([pos pos_sim])); %[output:6096ed56]
ylabel("deg"); %[output:6096ed56]
xlabel("time (s)"); %[output:6096ed56]
grid minor; %[output:6096ed56]
legend({"pos", "pos_{sim}"}); %[output:6096ed56]
%[text] ### Tune controller
C0  = tunablePID('C', 'pi');
AP1 = AnalysisPoint('AP1');
sys = feedback(C0 * plant * AP1, 1);
sys.InputName = "r";
sys.OutputName = "y";

fc = 20; % Hz
wc = 2*pi * fc;
responsetime = 2 / wc;  % s
dcerror      = 0;       % perc
maxOvershoot = 1;       % perc
gainMargin   = 3;       % dB
phaseMargin  = 60;      % deg

Rtrack = TuningGoal.Tracking('r', 'y', responsetime, dcerror);
Ros = TuningGoal.Overshoot('r', 'y', maxOvershoot);
Rmargin = TuningGoal.Margins('AP1', gainMargin, phaseMargin);

sys_tuned = systune(sys, [Rmargin Ros], Rtrack); %[output:8e3a97d0]
C = getBlockValue(sys_tuned, 'C') %[output:01a588d2]
figure; %[output:1e8b067d]
stepplot(sys_tuned); %[output:1e8b067d]
title('Tuned Step Response'); %[output:1e8b067d]
grid minor; %[output:1e8b067d]
figure; %[output:2aae7a60]
margin(C * plant); %[output:2aae7a60]
grid minor; %[output:2aae7a60]
%[text] ### Controller's gains to be specified in the robot configuration files
C_XML = (3360 / 100) * C;
C_XML %[output:8c663143]

